    constructor(c: Int) : this() {
        count = c
    }

    fun next(): String {
        count++
        val ret = when {
            count % 3 == 0 -> "aho"
            "$count".contains("3") -> "aho"
            else -> "$count"
        }
        return ret
    }
}

